{"strNational":null,"strProfessional":"","strInternational":"","strEvents":"<\/ul> <h3>\u0414\u043e XIX \u0432\u0435\u043a\u0430 <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1288_%D0%B3%D0%BE%D0%B4\" title=\"1288 \u0433\u043e\u0434\">1288<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%BE%D1%82%D0%BB%D0%B0%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0428\u043e\u0442\u043b\u0430\u043d\u0434\u0438\u044f\">\u0428\u043e\u0442\u043b\u0430\u043d\u0434\u0438\u044f<\/a> \u043e\u0431\u044a\u044f\u0432\u043b\u044f\u0435\u0442 \u044d\u0442\u043e\u0442 \u0434\u0435\u043d\u044c \u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e\u0441\u0442\u044c\u044e \u0436\u0435\u043d\u0449\u0438\u043d\u044b \u043f\u0440\u0435\u0434\u043b\u043e\u0436\u0438\u0442\u044c \u0431\u0440\u0430\u043a \u043c\u0443\u0436\u0447\u0438\u043d\u0435 . \u0423\u0441\u043b\u043e\u0432\u0438\u044f \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u0435: \u043d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u043e, \u0447\u0442\u043e\u0431\u044b \u00ab\u0432\u0441\u044f\u043a\u0430\u044f \u0434\u0430\u043c\u0430, \u043a\u043e\u0442\u043e\u0440\u0430\u044f \u0438\u0434\u0451\u0442 \u0441\u0432\u0430\u0442\u0430\u0442\u044c\u0441\u044f, \u043d\u0430\u0434\u0435\u0432\u0430\u043b\u0430 \u043d\u0438\u0436\u043d\u044e\u044e \u0441\u043e\u0440\u043e\u0447\u043a\u0443 \u0438\u0437 \u0431\u0430\u0433\u0440\u044f\u043d\u043e\u0439 \u0444\u043b\u0430\u043d\u0435\u043b\u0438 \u0438 \u0447\u0442\u043e\u0431\u044b \u043a\u0440\u043e\u043c\u043a\u0430 \u0435\u0451 \u0431\u044b\u043b\u0430 \u0445\u043e\u0440\u043e\u0448\u043e \u0432\u0438\u0434\u043d\u0430, \u0438\u043d\u0430\u0447\u0435 \u043c\u0443\u0436\u0447\u0438\u043d\u0435 \u043f\u0440\u0438\u0434\u0451\u0442\u0441\u044f \u0437\u0430\u043f\u043b\u0430\u0442\u0438\u0442\u044c \u0437\u0430 \u043d\u0435\u0451 \u0448\u0442\u0440\u0430\u0444\u00bb. \u0428\u0442\u0440\u0430\u0444 \u0441\u043e\u0441\u0442\u0430\u0432\u043b\u044f\u043b 1 \u0444\u0443\u043d\u0442. \u041e\u0442 \u043d\u0435\u0433\u043e \u043e\u0441\u0432\u043e\u0431\u043e\u0436\u0434\u0430\u043b\u0438 \u0442\u043e\u043b\u044c\u043a\u043e \u0432 \u0442\u043e\u043c \u0441\u043b\u0443\u0447\u0430\u0435, \u0435\u0441\u043b\u0438 \u043c\u0443\u0436\u0447\u0438\u043d\u0430 \u043c\u043e\u0433 \u0434\u043e\u043a\u0430\u0437\u0430\u0442\u044c, \u0447\u0442\u043e \u0443\u0436\u0435 \u043e\u0431\u0440\u0443\u0447\u0451\u043d \u0441 \u0434\u0440\u0443\u0433\u043e\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1504_%D0%B3%D0%BE%D0%B4\" title=\"1504 \u0433\u043e\u0434\">1504<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BB%D1%83%D0%BC%D0%B1,_%D0%A5%D1%80%D0%B8%D1%81%D1%82%D0%BE%D1%84%D0%BE%D1%80\" title=\"\u041a\u043e\u043b\u0443\u043c\u0431, \u0425\u0440\u0438\u0441\u0442\u043e\u0444\u043e\u0440\">\u0425\u0440\u0438\u0441\u0442\u043e\u0444\u043e\u0440 \u041a\u043e\u043b\u0443\u043c\u0431<\/a> \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%83%D0%BD%D0%BD%D0%BE%D0%B5_%D0%B7%D0%B0%D1%82%D0%BC%D0%B5%D0%BD%D0%B8%D0%B5\" title=\"\u041b\u0443\u043d\u043d\u043e\u0435 \u0437\u0430\u0442\u043c\u0435\u043d\u0438\u0435\">\u043b\u0443\u043d\u043d\u043e\u0435 \u0437\u0430\u0442\u043c\u0435\u043d\u0438\u0435<\/a> \u0434\u043b\u044f \u0437\u0430\u043f\u0443\u0433\u0438\u0432\u0430\u043d\u0438\u044f \u0432\u0440\u0430\u0436\u0434\u0435\u0431\u043d\u044b\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BC%D0%B0%D0%B9%D0%BA%D0%B0\" title=\"\u042f\u043c\u0430\u0439\u043a\u0430\">\u044f\u043c\u0430\u0439\u0441\u043a\u0438\u0445<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D0%B4%D0%B5%D0%B9%D1%86%D1%8B\" title=\"\u0418\u043d\u0434\u0435\u0439\u0446\u044b\">\u0438\u043d\u0434\u0435\u0439\u0446\u0435\u0432<\/a> .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1696_%D0%B3%D0%BE%D0%B4\" title=\"1696 \u0433\u043e\u0434\">1696<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%91%D1%82%D1%80_I\" title=\"\u041f\u0451\u0442\u0440 I\">\u041f\u0451\u0442\u0440 I<\/a> \u043f\u0440\u0438\u0431\u044b\u043b \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D1%80%D0%BE%D0%BD%D0%B5%D0%B6\" title=\"\u0412\u043e\u0440\u043e\u043d\u0435\u0436\">\u0412\u043e\u0440\u043e\u043d\u0435\u0436<\/a>, \u0447\u0442\u043e\u0431\u044b \u043b\u0438\u0447\u043d\u043e \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0438\u0442\u044c \u043f\u043e\u0441\u0442\u0440\u043e\u0439\u043a\u043e\u0439 \u043f\u0435\u0440\u0432\u044b\u0445 \u043a\u043e\u0440\u0430\u0431\u043b\u0435\u0439 \u0434\u043b\u044f \u043f\u043e\u0445\u043e\u0434\u0430 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B7%D0%BE%D0%B2\" title=\"\u0410\u0437\u043e\u0432\">\u0410\u0437\u043e\u0432<\/a>, \u043d\u0430 \u0432\u0435\u0440\u0444\u044c, \u0441\u0442\u0430\u0432\u0448\u0443\u044e \u0440\u043e\u0434\u0438\u043d\u043e\u0439 \u0440\u0443\u0441\u0441\u043a\u043e\u0433\u043e \u0444\u043b\u043e\u0442\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1720_%D0%B3%D0%BE%D0%B4\" title=\"1720 \u0433\u043e\u0434\">1720<\/a>&#160;\u2014 \u0448\u0432\u0435\u0434\u0441\u043a\u0430\u044f \u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%BB%D1%8C%D1%80%D0%B8%D0%BA%D0%B0_%D0%AD%D0%BB%D0%B5%D0%BE%D0%BD%D0%BE%D1%80%D0%B0\" title=\"\u0423\u043b\u044c\u0440\u0438\u043a\u0430 \u042d\u043b\u0435\u043e\u043d\u043e\u0440\u0430\">\u0423\u043b\u044c\u0440\u0438\u043a\u0430 \u042d\u043b\u0435\u043e\u043d\u043e\u0440\u0430<\/a> \u043e\u0442\u0440\u0435\u043a\u043b\u0430\u0441\u044c \u043e\u0442 \u043f\u0440\u0435\u0441\u0442\u043e\u043b\u0430 \u0432 \u043f\u043e\u043b\u044c\u0437\u0443 \u0441\u0432\u043e\u0435\u0433\u043e \u043c\u0443\u0436\u0430&#160;\u2014 \u043b\u0430\u043d\u0434\u0433\u0440\u0430\u0444\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B5%D0%B4%D1%80%D0%